import React from 'react'
import Sidebar from './Sidebar'
import MessageContainer from './MessageContainer'

const HomePage = ()=>{
    return (
        <div className='flex sm rounded-lg overflow-hidden bg-gray-400 bg-clip-padding backdrop-filter backdrop-blur-lg bg-opacity-0'>
            <Sidebar/>
            <MessageContainer/>
        </div>
    )
}

export default HomePage
